const Form = () => {

    const message = "hello";
    const inputVal = '';   

    return (
        <>
            <div>
                <div id="container">
                    <h3> {message} </h3>
                    <input type="text" placeholder="Enter Your Name" value={inputVal}/>
                    <button id="demo"> Submit </button>
                </div>
            </div>
        </>
    );
}


export default Form;
